import React from 'react';
import './popup.css'; 

function POPup(props) {
    const handleClick=()=>{
        console.log("clicked");
    }
    return (
        <div className="popup" onClick={handleClick}>
            <span className="show" id="myPopup">Popup text...</span>
        </div>
    );
}

export default POPup;
